(1, '2020-06-08 09:33:22', '2020-09-15 08:21:04', 'verswinkeldegroenevallei.be', '1597946152.jpg', 'JS6M518MS0', 'shopdesk@teamdigital.agency', 'f1597669155.png', '#411b1b', 4000, '', '', 12, 'b1pda1599927118.jpg', 's1597946152.jpg', 'd1597946152.jpg', 'fd', 'ds', '<p><br></p>', 1, 'Uw bestelling werd goed ontvangen!', 'Uw bestelling werd goedgekeurd!', 'Uw bestelling werd even \"on-hold\" gezet!', 'Uw home delivery werd goedgekeurd!', 'Uw bestelling werd geannuleerd!', '<div><p>Beste #name,</p><p>We hebben met succes de bestelling (#id) ontvangen, wij kijken deze na en U ontvangt een bevestigingsmail !</p></div><div><br></div>', '<div>Beste #name,</div><div><br></div><div>Uw bestelling werd door ons nagekeken en goedgekeurd. De bestelling kan afgehaald worden op&nbsp;<span style=\"color: rgb(33, 37, 41); background-color: rgba(0, 0, 0, 0.05);\">#date</span>&nbsp;om&nbsp;<span style=\"color: rgb(33, 37, 41);\">#pickup</span>.</div><div><br></div><div>Vriendelijke groetjes,&nbsp;</div><div>De Groene Vallei</div>', '<div>Beste #name,</div><div><br></div><div>Er werd een probleem vastgesteld ivm uw bestelling (#id) en deze werd even on hold gezet.</div><div><br></div><div>Wij zullen u even contacteren om te bekijken hoe we dit probleem kunnen oplossen.</div>', '<div>Beste #name,</div><div><br></div><div>Uw bestelling werd door ons nagekeken en goedgekeurd. Wij zullen dit aan huis leveren op #date tussen 9.00u en 11.00u. Van zodra wij uw bestelling hebben klaar gezet zal u van ons een sms ontvangen met daarin het totale bedrag en onze rekeningnummer.&nbsp;</div><div><br></div><div>LET OP: wij leveren enkel op ZONDAG aan huis en dit tussen 9.00u en 11.00u. Wij kunnen geen exact tijdstip garanderen.&nbsp;</div><div><br></div><div>Vriendelijke groetjes,&nbsp;</div><div>De Groene Vallei</div>', '<div>Beste #name,</div><div><br></div><div>Uw&nbsp; bestelling (#id) werd geannuleerd.</div>', 0, '', 1, 0, 'body{}', 'mail.teamdigital.agency', '587', 'shopdesk', 'TLS', 'shopdesk@teamdigital.agency', 'tnoOl)FvKS,C', '<div class=\"social-media-section\">\r\n    <h2>Volg&nbsp;ons</h2>\r\n    <div class=\"social-links\">\r\n        <a class=\"facebook\" href=\"https://www.facebook.com/brebelsbree/\" data-tooltip=\"Facebook\"><i class=\"fa fa-facebook\"></i></a>\r\n    </div>\r\n</div>', 'Olenseweg 292, 2260 Westerlo', '014 26 71 27', 'info@degroenevallei.net', '19', '14', 'paypal', '<div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12 text-center\">\r\n    <!--=======  copyright text	  =======-->\r\n\r\n    <div class=\"copyright-segment\">\r\n<div class=\"vu_mf-sf-content text-center\">\r\n© 2020. verswinkeldegroenevallei.be. Alle rechten voorbehouden. Powered by <a href=\"http://teamdigital.be\" target=\"_blank\">Teamdigital</a>											</div>\r\n\r\n    </div>\r\n\r\n    <!--=======  End of copyright text	  =======-->\r\n\r\n</div>', 0, '15', '0', '<p>Beste #name</p><p>Bedankt voor uw registratie op onze website.</p><p>Wij wensen u veel shopplezier!</p>', 'U bent succesvol geregistreerd op onze website!', 'elienvervloet@skynet.be', 'Bedankt voor uw bestelling!', '<p>Beste #name</p><p>Uw bestelling (#id) werd succesvol uitgevoerd!</p><p>Van zodra wij uw bestelling hebben nagekeken en goedgekeurd ontvangt u van ons een bevestigingsmail !</p><p>Vriendelijke groetjes,&nbsp;</p><p>De Groene Vallei</p>', 'Nieuwe bestelling!', '<p>Beste shop manager,</p><p>Er werd zonet een bestelling gedaan op uw online webwinkel.</p><p>U kan de bestelling hier bekijken:<br>http://webshop.teamdigital.agency/signup?ref=my-account</p><p><br></p>', NULL, NULL, 'b21599927118.jpg', 'b31599927118.jpg', 'b41599927118.jpg', '');
